import React from 'react'
import { Link } from 'react-router-dom';

export default function EventsPage() {

    const DUMMY_EVENTS = [
        { id: "p1", title: "Studing" },
        { id: "p2", title: "React" },
        { id: "p3", title: "Life" },
    ];

  return (
    <>
        <h1>My Events</h1>
        <ul>
            {DUMMY_EVENTS.map((e) => (
                <li key={e.id}>
                    <Link to={e.id}>{e.title}</Link>
                </li>
            ))}
        </ul>
    </>
  )
}
